// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract Airdrop is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event AddToWhitelist(address account);

    IERC20 public token;
    address public tokenWallet;
    uint256 public airdropAmount;

    // whitelist
    struct WhitelistInfo {
        address token;
        bool isRemove;
        address[] member;
    }
    mapping (address => WhitelistInfo) private _whitelist;
    // Record the information of all invited personnel
    struct InviteInfo {
        address inviterToken;
        uint256 airdropAmount;
    }
    mapping (address => InviteInfo) public airdropList;

    constructor(IERC20 _token, address _tokenWallet, uint256 _airdropAmount) Ownable() {
        require(address(_token) != address(0), "Airdrop: The token is the zero address");
        require(_tokenWallet != address(0), "Airdrop: The token wallet is the zero address");

        token = _token;
        tokenWallet = _tokenWallet;
        airdropAmount = _airdropAmount;
    }

    /**
     * @dev get member list from the whitelist by owner
     */
    function getMemberListByOwner(address account) public onlyOwner view returns (address[] memory) {
        return _getMemberList(account);
    }

    /**
     * @dev get member list from the whitelist by owner
     */
    function getMemberList() public view returns (address[] memory) {
        require(hasWhitelist(msg.sender), "Airdrop: The account is not in the whitelist");
        return _getMemberList(msg.sender);
    }

    /**
     * @dev get member list from the whitelist
     */
    function _getMemberList(address account) internal view returns (address[] memory) {
        WhitelistInfo storage info = _whitelist[account];
        return info.member;
    }

    /**
     * @dev remove single account from the whitelist by owner
     * @param account the address of whitelist
     */
    function removeFromWhitelist(address account) public onlyOwner {
        require(hasWhitelist(account), "Airdrop: The account is not in the whitelist");
        WhitelistInfo storage info = _whitelist[account];
        info.isRemove = true;
    }

    /**
     * @dev add account list to the whitelist by owner
     * @param accountList the address of whitelist
     */
    function addMutliToWhitelist(address[] memory accountList) public onlyOwner {
        require(accountList.length > 0, "Airdrop: The account list is null");
        for (uint i = 0; i < accountList.length; i++) {
            _addToWhitelist(accountList[i]);
        }
    }

    /**
     * @dev add single account to the whitelist by owner
     * @param account the address of whitelist
     */
    function addToWhitelist(address account) public onlyOwner {
        require(!hasWhitelist(account), "Airdrop: The account is already on the whitelist");
        require(!hasAirdropList(account), "Airdrop: The account is already on the airdropList");
        _addToWhitelist(account);

        emit AddToWhitelist(account);
    }

    /**
     * @dev add account to the whitelist
     * @param account the address of whitelist
     */
    function _addToWhitelist(address account) internal {
        if (!hasWhitelist(account) && !hasAirdropList(account)) {
            WhitelistInfo storage info = _whitelist[account];
            if (info.token != address(0)) {
                info.isRemove = false;
            } else {
                _whitelist[account] = WhitelistInfo(account, false, new address[](0));
            }
        }
    }

    /**
     * @dev Check if an account has this whitelist.
     * @param account the address of whitelist
     * @return bool
     */
    function hasWhitelist(address account) public view returns (bool) {
        require(address(account) != address(0), "Airdrop: The account is the zero address");
        WhitelistInfo storage whitelistInfo = _whitelist[account];
        return whitelistInfo.token != address(0) && !whitelistInfo.isRemove;
    }

    /**
     * @dev Check if an account has this airdroplist.
     * @param account the address of airdropList
     * @return bool
     */
    function hasAirdropList(address account) public view returns (bool) {
        require(address(account) != address(0), "Airdrop: The account is the zero address");
        InviteInfo storage inviteInfo = airdropList[account];
        return inviteInfo.inviterToken != address(0);
    }

    /**
     * @dev Receive airdrop
     * @param inviterAccount the account of receive's inviter
     */
    function receiveAirdrop(address inviterAccount) public {
        require(inviterAccount != address(0), "Airdrop: The inviter account is the zero address");
        require(inviterAccount != msg.sender, "Airdrop: The inviter account cannot be yourself");
        require(hasWhitelist(inviterAccount), "Airdrop: The inviter account is not in the whitelist");
        require(!hasWhitelist(msg.sender), "Airdrop: The invitee account is already on the whitelist");
        require(!hasAirdropList(msg.sender), "Airdrop: The invitee account is already on the airdropList");

        // random to airdrop amount
        uint256 actualAmount = _getActualAmount();

        // add to airdropList
        airdropList[msg.sender] = InviteInfo(inviterAccount, actualAmount);
        // add to whitelist member
        WhitelistInfo storage whitelistInfo = _whitelist[inviterAccount];
        whitelistInfo.member.push(msg.sender);
        // transfer token to receive account
        token.safeTransferFrom(tokenWallet, msg.sender, actualAmount);
    }

    /**
     * @dev Get actual amount
     */
    function _getActualAmount() internal view returns(uint256) {
        // random to airdrop amount
        uint256 randomAmount = _rand(airdropAmount);
        if (randomAmount < 1) {
            randomAmount = 1;
        } else if (randomAmount > airdropAmount) {
            randomAmount = airdropAmount;
        }
        uint256 actualAmount = randomAmount * (10**uint256(18));
        return actualAmount;
    }

    /**
     * @dev Generate random numbers
     * @param length Random number range
     */
    function _rand(uint256 length) internal view returns(uint256) {
        uint256 random = uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp)));
        return random % length;
    }

    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}

